import React, { useEffect, useState } from 'react';

function AIVisual() {
  const [activeStep, setActiveStep] = useState(0);

  const dataAnalysisSteps = [
    "Data Collection",
    "Preprocessing",
    "Feature Engineering",
    "Model Training",
    "Evaluation"
  ];

  useEffect(() => {
    const timer = setInterval(() => {
      setActiveStep(prev => (prev < dataAnalysisSteps.length - 1 ? prev + 1 : 0));
    }, 2000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="visual-container" style={{
      position: 'relative',
      width: '600px',
      height: '600px',
    }}>
      {/* Main Analysis Dashboard */}
      <div style={{
        position: 'relative',
        width: '450px',
        height: '380px',
        margin: '50px auto',
        backgroundColor: 'rgba(13, 14, 20, 0.95)',
        borderRadius: '24px',
        overflow: 'hidden',
        border: '1px solid rgba(99, 179, 237, 0.2)',
        boxShadow: '0 0 40px rgba(99, 179, 237, 0.15)',
      }}>
        {/* Dashboard Header */}
        <div style={{
          padding: '15px 20px',
          borderBottom: '1px solid rgba(99, 179, 237, 0.1)',
          background: 'linear-gradient(90deg, rgba(99, 179, 237, 0.1), rgba(66, 153, 225, 0.1))',
        }}>
          <span style={{ color: '#63B3ED' }}>ML Pipeline Analysis</span>
        </div>

        {/* Data Visualization Section */}
        <div style={{ padding: '20px' }}>
          {/* Scatter Plot */}
          <div style={{
            height: '150px',
            marginBottom: '20px',
            display: 'flex',
            alignItems: 'flex-end',
            gap: '8px',
            padding: '10px',
            backgroundColor: 'rgba(99, 179, 237, 0.05)',
            borderRadius: '12px',
          }}>
            {Array.from({ length: 15 }).map((_, i) => (
              <div
                key={i}
                style={{
                  width: '8px',
                  height: `${30 + Math.random() * 100}px`,
                  backgroundColor: '#63B3ED',
                  opacity: 0.7,
                  borderRadius: '4px',
                  animation: `growBar 1s ease-out ${i * 0.1}s`,
                }}
              />
            ))}
          </div>

          {/* Pipeline Progress */}
          <div style={{
            marginBottom: '20px',
            padding: '15px',
            backgroundColor: 'rgba(99, 179, 237, 0.05)',
            borderRadius: '12px',
          }}>
            {dataAnalysisSteps.map((step, index) => (
              <div
                key={step}
                style={{
                  display: 'flex',
                  alignItems: 'center',
                  gap: '10px',
                  marginBottom: '10px',
                  opacity: index <= activeStep ? 1 : 0.5,
                  transition: 'all 0.3s ease',
                }}
              >
                <div style={{
                  width: '20px',
                  height: '20px',
                  borderRadius: '50%',
                  backgroundColor: index <= activeStep ? '#63B3ED' : 'rgba(99, 179, 237, 0.2)',
                  display: 'flex',
                  alignItems: 'center',
                  justifyContent: 'center',
                  fontSize: '12px',
                  color: '#fff',
                }}>
                  {index + 1}
                </div>
                <div style={{ color: '#fff' }}>{step}</div>
              </div>
            ))}
          </div>

          {/* Metrics */}
          <div style={{
            display: 'grid',
            gridTemplateColumns: 'repeat(2, 1fr)',
            gap: '10px',
          }}>
            {[
              { label: 'Accuracy', value: '94.5%' },
              { label: 'F1 Score', value: '0.92' },
              { label: 'Precision', value: '0.89' },
              { label: 'Recall', value: '0.95' },
            ].map((metric) => (
              <div
                key={metric.label}
                style={{
                  padding: '10px',
                  backgroundColor: 'rgba(99, 179, 237, 0.05)',
                  borderRadius: '8px',
                  animation: 'fadeIn 0.5s ease-out',
                }}
              >
                <div style={{ color: '#63B3ED', fontSize: '12px' }}>{metric.label}</div>
                <div style={{ color: '#fff', fontSize: '18px' }}>{metric.value}</div>
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Floating Tech Stack */}
      {[
        { text: "Python", icon: "ðŸ" },
        { text: "Pandas", icon: "ðŸ“Š" },
        { text: "Scikit-learn", icon: "ðŸ¤–" },
        { text: "TensorFlow", icon: "ðŸ“ˆ" },
        { text: "PyTorch", icon: "ðŸ”¥" },
      ].map((tech, index) => (
        <div
          key={index}
          style={{
            position: 'absolute',
            padding: '8px 16px',
            background: 'rgba(99, 179, 237, 0.1)',
            borderRadius: '20px',
            top: `${20 + index * 15}%`,
            right: `${70 + (index % 2) * 20}%`,
            color: '#63B3ED',
            fontSize: '14px',
            backdropFilter: 'blur(5px)',
            border: '1px solid rgba(99, 179, 237, 0.2)',
            animation: `float ${2 + index}s infinite ease-in-out ${index * 0.5}s`,
            display: 'flex',
            alignItems: 'center',
            gap: '8px',
            cursor: 'pointer',
            transition: 'all 0.3s ease',
          }}
          onMouseEnter={e => {
            e.target.style.transform = 'scale(1.1)';
            e.target.style.backgroundColor = 'rgba(99, 179, 237, 0.2)';
          }}
          onMouseLeave={e => {
            e.target.style.transform = 'scale(1)';
            e.target.style.backgroundColor = 'rgba(99, 179, 237, 0.1)';
          }}
        >
          <span>{tech.icon}</span>
          {tech.text}
        </div>
      ))}

      {/* Data Flow Lines */}
      <svg style={{
        position: 'absolute',
        top: 0,
        left: 0,
        width: '100%',
        height: '100%',
        pointerEvents: 'none',
      }}>
        {Array.from({ length: 6 }).map((_, i) => (
          <line
            key={i}
            x1={`${30 + Math.random() * 40}%`}
            y1={`${20 + Math.random() * 60}%`}
            x2={`${50 + Math.random() * 40}%`}
            y2={`${40 + Math.random() * 40}%`}
            stroke="#63B3ED"
            strokeWidth="1"
            strokeOpacity="0.2"
            strokeDasharray="4"
          >
            <animate
              attributeName="strokeOpacity"
              values="0.2;0.5;0.2"
              dur={`${2 + Math.random() * 2}s`}
              repeatCount="indefinite"
            />
          </line>
        ))}
      </svg>
    </div>
  );
}

export default AIVisual;
